import "./MenuList.scss";

export const InputSwitch = () => {
  return (
    <label>
      <input role="switch" type="checkbox" />
    </label>
  );
};

export const InputRadio = () => {
  return (
    <label>
      <input name="" type="radio" />
    </label>
  );
};
